--
-- Name: parcel_overlap(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.parcel_overlap() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
    c INT;
BEGIN
    SELECT count(*)
    INTO c
    FROM a01_parcel_main
    WHERE ST_Intersects(a01_parcel_main.geom, NEW.geom)
    AND a01_parcel_main.file_no != NEW.file_no
    AND ST_Relate(a01_parcel_main.geom, NEW.geom, '2********');

    IF c > 0 THEN
        RAISE EXCEPTION 'overlap detected on parcel with file no % or an attempt has been made to change the file no', NEW.file_no;
    END IF;

    RETURN NEW;
END;
$$;


